import React from 'react'

const ListItem = (props) => {
  const {
    id,
    task,
    onClickDelete
  } = props
  return (
    <div 
      onClick =  {() => onClickDelete(id)}
    >
      <li> {task} </li>
    </div>
  )
}

export default ListItem
